■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">「高濃度プラセンタエキス」と「スクワレン」に、肌の健康とつながりの深い「ビタミンB群」を配合した美容サプリです。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">58.44g(1球重量487mg(内容量300mg)×120粒)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">52×52×93mm</font><br><font color="#333333" size="-1">個装サイズ：6×6×10cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：173g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">成分</font></td><td align="left"><font color="#333333" size="-1">【4粒(1.9g)あたり】<br>スクワレン…558mg<br>プラセンタエキス…480mg(製造時配合量)　<br><br>試験依頼先:財団法人日本食品分析センター、試験成績書発行番号:第209010891-001号</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">商品区分:栄養機能食品(ビタミンＥ、ビタミンB1、ビオチン)</font><br><font color="#333333" size="-1">名称:プラセンタエキス含有食品</font><br><font color="#333333" size="-1">保存方法：品質保持のため、高温・多湿及び直射日光を避け冷暗所に保存してください。</font><br> <font color="#333333" size="-1">賞味期間：製造日より720日</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
